import "./TopBar.css";
import { Link } from "react-router-dom";

const TopBar = () => {
  return (
    <div className="topnav">
      <a>
        <Link to="/" className="nav-link">
          Employees
        </Link>
      </a>

      <a>
        <Link to="/add-employee" className="nav-link">
          Add Employee
        </Link>
      </a>
    </div>
  );
};

export default TopBar;
